import React from 'react';
import './App.css';
import SmoothScroll from 'smooth-scroll';
import SoundTile from './SoundTile';
import HomePage from './components/HomePage';
import ForestPage from './components/ForestPage';
import BeachPage from './components/BeachPage';
import UrbanPage from './components/UrbanPage';

function App() {
  React.useEffect(() => {
    new SmoothScroll('a[href*="#"]', {
      speed: 800,
    });
  }, []);

  return (
    <div className="App">
      <div id="home"><HomePage /></div>
      <div id="forest"><ForestPage /></div>
      <div id="beach"><BeachPage /></div>
      <div id="urban"><UrbanPage /></div>
    </div>
  );
}

export default App;
